import Nav from 'react-bootstrap/Nav';
import '../css/Navbar.css';
import React, {Component} from 'react';
import pages from '../pages.json'


class Navbar extends Component {

    constructor(props){
        super(props);
        this.onSelect = (props.onSelect === undefined) ? (id) => console.log("Navigation selected", id) : props.onSelect;
    }

    render(){
        this.content_left = pages.left.map((item) => {
            return (
                <Nav.Item key={"item_"+item.id}>
                    <Nav.Link activekey={"link_"+item.id} onSelect={() => this.onSelect(item.id)} href={"#"+item.id}> {item.title} </Nav.Link>
                </Nav.Item>
            )
        });

        this.content_right = pages.right.map((item) => {
            return (
                <Nav.Item key={"item_"+item.id}>
                    <Nav.Link activekey={"link_"+item.id} onSelect={() => this.onSelect(item.id)} href={"#"+item.id}> {item.title} </Nav.Link>
                </Nav.Item>
            )
        });

        return (
            <Nav className={"clearfix"}>
                <div className={"left"}>
                    {this.content_left}
                </div>

                <div className={"right"}>
                    {this.content_right}
                </div>
            </Nav>
        )
    }
}

export default Navbar;
